import React from 'react';
import { Image } from 'react-bootstrap'



const Headshot = props => {

    return(
        <div style={styles.imageContainer}>
            <Image src={props.imageSource} fluid/>
        </div>
    )

}

const styles = {
    imageContainer: {
        border: '1em solid white',
        position: 'relative',
        overflow: 'hidden'

    }
}

export default Headshot;
